import React , { useEffect, useState } from 'react';
import Weather from './components/Weather';


import './App.css';

const App = () => {

  const APP_KEY = "656c98d724799f2308debe601f2c29b3";


  const [weather, setWeather] = useState([]);

  useEffect( () => {
    getWeather();

  },[]);


  const getWeather = async () => {
    const response = await fetch(`http://api.openweathermap.org/data/2.5/weather?q=London,uk&APPID=${APP_KEY}`);
    const data = await response.json();
    setWeather(data);
    console.log(data);

  }



  return (
    <div>
      <h1>Weather-Finder</h1>


           <Weather weather={weather} />




    </div>

  );

};

export default App;
